import {
    withGoogleMap,
    GoogleMap,
    Marker,
} from "react-google-maps";

const MapWithAMarker = withGoogleMap(props =>
    <GoogleMap
        defaultZoom={8}
        defaultCenter={{ lat: 21.027763, lng: 105.834160 }}
    >
        <Marker
            position={{ lat: -34.397, lng: 105.834160 }}
        />
    </GoogleMap>
);


export default MapWithAMarker;
